      out.write("<script>\r\n");
      out.write("\r\n");
      out.write("if (typeof(SIDEVIEW_JS) == 'undefined') // 한번만 실행\r\n");
      out.write("{\r\n");
      out.write("    if (typeof g4_is_member == 'undefined')\r\n");
      out.write("        alert('member undefined');\r\n");
      out.write("\r\n");
      out.write("    var SIDEVIEW_JS = true;\r\n");
      out.write("\r\n");
      out.write("    // 회원이름 클릭시 회원정보등을 보여주는 레이어\r\n");
      out.write("    function insertHead(name, text, evt)\r\n");
      out.write("    {\r\n");
      out.write("        var idx = this.heads.length;\r\n");
      out.write("        var row = new SideViewRow(-idx, name, text, evt);\r\n");
      out.write("        this.heads[idx] = row;\r\n");
      out.write("        return row;\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("    function insertTail(name, evt)\r\n");
      out.write("    {\r\n");
      out.write("        var idx = this.tails.length;\r\n");
      out.write("        var row = new SideViewRow(idx, name, evt);\r\n");
      out.write("        this.tails[idx] = row;\r\n");
      out.write("        return row;\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("    function SideViewRow(idx, name, onclickEvent)\r\n");
      out.write("    {\r\n");
      out.write("        this.idx = idx;\r\n");
      out.write("        this.name = name;\r\n");
      out.write("        this.onclickEvent = onclickEvent;\r\n");
      out.write("        this.renderRow = renderRow;\r\n");
      out.write("\r\n");
      out.write("        this.isVisible = true;\r\n");
      out.write("        this.isDim = false;\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("    function renderRow()\r\n");
      out.write("    {\r\n");
      out.write("        if (!this.isVisible)\r\n");
      out.write("            return \"\";\r\n");
      out.write("\r\n");
      out.write("        var str = \"\" + this.onclickEvent + \"\";\r\n");
      out.write("        return str;\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("    function showSideView(curObj, mb_id, name, email, homepage)\r\n");
      out.write("    {\r\n");
      out.write("        var sideView = new SideView('nameContextMenu', curObj, mb_id, name, email, homepage);\r\n");
      out.write("        sideView.showLayer();\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("    function SideView(targetObj, curObj, mb_id, name, email, homepage)\r\n");
      out.write("    {\r\n");
      out.write("        this.targetObj = targetObj;\r\n");
      out.write("        this.curObj = curObj;\r\n");
      out.write("        this.mb_id = mb_id;\r\n");
      out.write("        name = name.replace(/…/g,\"\");\r\n");
      out.write("        this.name = name;\r\n");
      out.write("        this.email = email;\r\n");
      out.write("        this.homepage = homepage;\r\n");
      out.write("        this.showLayer = showLayer;\r\n");
      out.write("        this.makeNameContextMenus = makeNameContextMenus;\r\n");
      out.write("        this.heads = new Array();\r\n");
      out.write("        this.insertHead = insertHead;\r\n");
      out.write("        this.tails = new Array();\r\n");
      out.write("        this.insertTail = insertTail;\r\n");
      out.write("        this.getRow = getRow;\r\n");
      out.write("        this.hideRow = hideRow;\r\n");
      out.write("        this.dimRow = dimRow;\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("        if (g4_is_member) {\r\n");
      out.write("            if (mb_id)\r\n");
      out.write("                this.insertTail(\"msg\", \"<tr onMouseOver=this.style.backgroundColor='#bbbbbb' onMouseOut=this.style.backgroundColor='' id='sideViewRow_\"+this.name+\"' onClick=location.href='./write.asp?toid=\" + mb_id + \"&tonickname=\" + name + \"'><td style='font-family:굴림;font-size:9pt;' height='20'><font color='#000000'><span id='sideview' style='cursor:pointer'>쪽지보내기</span></font></td></tr>\");\r\n");
      out.write("            if (mb_id)\r\n");
      out.write("                this.insertTail(\"fadd\", \"<tr onMouseOver=this.style.backgroundColor='#bbbbbb' onMouseOut=this.style.backgroundColor='' id='sideViewRow_\"+this.name+\"' onClick=location.href='./write_f.asp?fid=\" + mb_id + \"&fnic=\" + name + \"'><td style='font-family:굴림;font-size:9pt;' height='20'><font color='#000000'><span id='sideview' style='cursor:pointer'>친구추가</span></font></td></tr>\");\r\n");
      out.write("\t\t\tif (mb_id)\r\n");
      out.write("                this.insertTail(\"info\", \"<tr onMouseOver=this.style.backgroundColor='#bbbbbb' onMouseOut=this.style.backgroundColor='' id='sideViewRow_\"+this.name+\"' onClick=location.href='./info.asp?id=\" + mb_id + \"';><td style='font-family:굴림;font-size:9pt;' height='20'><font color='#000000'><span id='sideview' style='cursor:pointer'>회원정보</span></font></td></tr>\");\r\n");
      out.write("\t\t}\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("    function showLayer()\r\n");
      out.write("    {\r\n");
      out.write("        clickAreaCheck = true;\r\n");
      out.write("        var oSideViewLayer = document.getElementById(this.targetObj);\r\n");
      out.write("        var oBody = document.body;\r\n");
      out.write("\r\n");
      out.write("        if (oSideViewLayer == null) {\r\n");
      out.write("            oSideViewLayer = document.createElement(\"DIV\");\r\n");
      out.write("            oSideViewLayer.id = this.targetObj;\r\n");
      out.write("            oSideViewLayer.style.position = 'absolute';\r\n");
      out.write("            oBody.appendChild(oSideViewLayer);\r\n");
      out.write("        }\r\n");
      out.write("        oSideViewLayer.innerHTML = this.makeNameContextMenus();\r\n");
      out.write("\r\n");
      out.write("        if (getAbsoluteTop(this.curObj) + this.curObj.offsetHeight + oSideViewLayer.scrollHeight + 5 > oBody.scrollHeight)\r\n");
      out.write("            oSideViewLayer.style.top = getAbsoluteTop(this.curObj) - oSideViewLayer.scrollHeight;\r\n");
      out.write("        else\r\n");
      out.write("            oSideViewLayer.style.top = getAbsoluteTop(this.curObj) + this.curObj.offsetHeight;\r\n");
      out.write("\r\n");
      out.write("        oSideViewLayer.style.left = getAbsoluteLeft(this.curObj) - this.curObj.offsetWidth + 14;\r\n");
      out.write("\r\n");
      out.write("        divDisplay(this.targetObj, 'block');\r\n");
      out.write("\r\n");
      out.write("        selectBoxHidden(this.targetObj);\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("    function getAbsoluteTop(oNode)\r\n");
      out.write("    {\r\n");
      out.write("        var oCurrentNode=oNode;\r\n");
      out.write("        var iTop=0;\r\n");
      out.write("        while(oCurrentNode.tagName!=\"BODY\") {\r\n");
      out.write("            iTop+=oCurrentNode.offsetTop - oCurrentNode.scrollTop;\r\n");
      out.write("            oCurrentNode=oCurrentNode.offsetParent;\r\n");
      out.write("        }\r\n");
      out.write("        return iTop;\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("    function getAbsoluteLeft(oNode)\r\n");
      out.write("    {\r\n");
      out.write("        var oCurrentNode=oNode;\r\n");
      out.write("        var iLeft=0;\r\n");
      out.write("        iLeft+=oCurrentNode.offsetWidth;\r\n");
      out.write("        while(oCurrentNode.tagName!=\"BODY\") {\r\n");
      out.write("            iLeft+=oCurrentNode.offsetLeft;\r\n");
      out.write("            oCurrentNode=oCurrentNode.offsetParent;\r\n");
      out.write("        }\r\n");
      out.write("        return iLeft;\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("    function makeNameContextMenus()\r\n");
      out.write("    {\r\n");
      out.write("        var str = \"<table border='0' cellpadding='3' cellspacing='0' width='90' style='border:1px solid #222222;' bgcolor='#FFFFFF'>\";\r\n");
      out.write("\r\n");
      out.write("        var i=0;\r\n");
      out.write("        for (i=this.heads.length - 1; i >= 0; i--)\r\n");
      out.write("            str += this.heads[i].renderRow();\r\n");
      out.write("\r\n");
      out.write("        var j=0;\r\n");
      out.write("        for (j=0; j < this.tails.length; j++)\r\n");
      out.write("            str += this.tails[j].renderRow();\r\n");
      out.write("\r\n");
      out.write("        str += \"</table>\";\r\n");
      out.write("        return str;\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("    function getRow(name)\r\n");
      out.write("    {\r\n");
      out.write("        var i = 0;\r\n");
      out.write("        var row = null;\r\n");
      out.write("        for (i=0; i<this.heads.length; ++i)\r\n");
      out.write("        {\r\n");
      out.write("            row = this.heads[i];\r\n");
      out.write("            if (row.name == name) return row;\r\n");
      out.write("        }\r\n");
      out.write("\r\n");
      out.write("        for (i=0; i<this.tails.length; ++i)\r\n");
      out.write("        {\r\n");
      out.write("            row = this.tails[i];\r\n");
      out.write("            if (row.name == name) return row;\r\n");
      out.write("        }\r\n");
      out.write("        return row;\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("    function hideRow(name)\r\n");
      out.write("    {\r\n");
      out.write("        var row = this.getRow(name);\r\n");
      out.write("        if (row != null)\r\n");
      out.write("            row.isVisible = false;\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("    function dimRow(name)\r\n");
      out.write("    {\r\n");
      out.write("        var row = this.getRow(name);\r\n");
      out.write("        if (row != null)\r\n");
      out.write("            row.isDim = true;\r\n");
      out.write("    }\r\n");
      out.write("    // Internet Explorer에서 셀렉트박스와 레이어가 겹칠시 레이어가 셀렉트 박스 뒤로 숨는 현상을 해결하는 함수\r\n");
      out.write("    // 레이어가 셀렉트 박스를 침범하면 셀렉트 박스를 hidden 시킴\r\n");
      out.write("    // <div id=LayerID style=\"display:none; position:absolute;\" onpropertychange=\"selectBoxHidden('LayerID')\">\r\n");
      out.write("    function selectBoxHidden(layer_id)\r\n");
      out.write("    {\r\n");
      out.write("        //var ly = eval(layer_id);\r\n");
      out.write("        var ly = document.getElementById(layer_id);\r\n");
      out.write("\r\n");
      out.write("        // 레이어 좌표\r\n");
      out.write("        var ly_left   = ly.offsetLeft;\r\n");
      out.write("        var ly_top    = ly.offsetTop;\r\n");
      out.write("        var ly_right  = ly.offsetLeft + ly.offsetWidth;\r\n");
      out.write("        var ly_bottom = ly.offsetTop + ly.offsetHeight;\r\n");
      out.write("\r\n");
      out.write("        // 셀렉트박스의 좌표\r\n");
      out.write("        var el;\r\n");
      out.write("\r\n");
      out.write("        for (i=0; i<document.forms.length; i++) {\r\n");
      out.write("            for (k=0; k<document.forms[i].length; k++) {\r\n");
      out.write("                el = document.forms[i].elements[k];\r\n");
      out.write("                if (el.type == \"select-one\") {\r\n");
      out.write("                    var el_left = el_top = 0;\r\n");
      out.write("                    var obj = el;\r\n");
      out.write("                    if (obj.offsetParent) {\r\n");
      out.write("                        while (obj.offsetParent) {\r\n");
      out.write("                            el_left += obj.offsetLeft;\r\n");
      out.write("                            el_top  += obj.offsetTop;\r\n");
      out.write("                            obj = obj.offsetParent;\r\n");
